import '../css_files/App.css';
import '../css_files/HomePage.css';

export function HomePage() {



    return (
        <div id="mainFrame">
            <div id="intro">
                <h1 id="hello"> HI, I'M WILL</h1>
                <div id="blurb">
                    <p id="blurbText">I'm a student at <a href="https://www.brown.edu/">Brown University</a>, concentrating in Computer Science and Business Economics.</p>
                </div>
            </div>
            <div id="projects">
                <h1>Projects</h1>
            </div>

            <div id="aboutMe">
                <h1>About Me</h1>
            </div>
        </div>
    );
}
